import './Catalogue.css';

function Catalogue(){
    var foodCategory = document.getElementById("foodCategory").value;
    var foodName = document.getElementById("foodName").value;
    var paymentMethod = document.getElementById("paymentMethod").value;

    if (foodCategory === "" || foodName === "" || paymentMethod === "") {
        alert("Please fill in all fields.");
        return false; 
    }
    return(    
        <div>
            <center>
        <form id="foodForm" onsubmit="return validateForm()"/>
    <label for="foodCategory">Food Category:</label>
    <select id="foodCategory" required>
        <option value="VEG">VEG</option>
        <option value="NON-VEG">NON-VEG</option>
    </select><br></br>
    <label for="foodName">Food Name:</label>
    <input type="text" id="foodName" placeholder="Enter the food" required/><br></br>

    <label for="paymentMethod">Price:</label>
    <select id="paymentMethod" required>
        <option value="Cash">Cash</option>
        <option value="Card">Card</option>
        <option value="UPI">UPI</option>
    </select><br></br>

    <input type="submit" value="ADD"/>
    </center></div>

    )
}
    
export default ca;
